import React, { Component } from 'react';
import CarModel from './CarModel';

const baseURL = `http://localhost:8080/api/models?make={make}`

class ModelsList extends Component {

  state = {
    models: []
  }

  getModels = () => {
    fetch(baseURL)
    .then(res => res.json())
    .then(data => this.setState({
      models: data
    }))
  }

  render() {
    return (
      <div>
      THis is Models List
      <CarModel />
      </div>
    );
  }

}

export default ModelsList;
